    false,nt"url": null,nt"notes": "Biota samples were collected from several
    islands in Green Bay and Lake Michigan during 1987-1988 and were analyzed for various
    organochlorines and metals. PCBs and DDE were detected at all locations, and concentrations
    were higher in fish-eating species such as herring gulls (Larus argentatus) and
    double-crested cormorants (Phalacrocorax auritus) than in waterfowl species. In
    addition, oxychlordane, hexachlorobenzene (HCB), beta-BHC, delta-BHC, alpha-chlordane,
    gamma-chlordane, trans-nonachlor, cis-nonachlor, heptachlor epoxide, DDD, DDT, dieldrin,
    and mirex were found in various samples. Although remaining relatively high, PCB,
    DDE, and dieldrin levels have decreased in some biota during the past ten years.
    Local sources of PCBs were important in cormorants, as levels in adult males increased
    temporally from 43.0 ppm during pre-nesting stage to 84.8 ppm during incubating
    stage. In cormorants, differences in PCB and DDE variability between clutches compared
    to variability within clutches indicates that single eggs can be used to characterize
    the contaminant burdens of entire clutches.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
